package bean;

public class hangbean {
	private String mahangxe;
	private String tenhangxe;
	private String anhhangxe;
	public hangbean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public hangbean(String mahangxe, String tenhangxe, String anhhangxe) {
		super();
		this.mahangxe = mahangxe;
		this.tenhangxe = tenhangxe;
		this.anhhangxe = anhhangxe;
	}
	public String getMahangxe() {
		return mahangxe;
	}
	public void setMahangxe(String mahangxe) {
		this.mahangxe = mahangxe;
	}
	public String getTenhangxe() {
		return tenhangxe;
	}
	public void setTenhangxe(String tenhangxe) {
		this.tenhangxe = tenhangxe;
	}
	public String getAnhhangxe() {
		return anhhangxe;
	}
	public void setAnhhangxe(String anhhangxe) {
		this.anhhangxe = anhhangxe;
	}
	
	
	
}
